import React from "react";
import Question from "./Question";

const QuestionTable = (props) => {
  const questions = props.questions;
  console.log(questions);
  return (
    <table>
      <tr>
        <th>Question ID</th>
        <th>Title</th>
        <th>Description</th>
        <th>Category</th>
        <th>Complexity</th>
      </tr>

      {questions.map((qn) => (
        <Question question_data={qn} />
      ))}
    </table>
  );
};

export default QuestionTable;
